svg.script:



    function mouseMove(evt,mouseovertext,mouseovertext2,currID) {

        var p = document.documentElement.createSVGPoint();
        p.x = evt.clientX;
        p.y = evt.clientY;
        var bClient = true;

		var textNode = document.getElementById("tooltip");
        textNode.textContent = mouseovertext;

        var municipios = document.getElementById(currID);
		var textNode2 = document.getElementById("tooltip2");
		textNode2.textContent = mouseovertext2;

		var fundo = document.getElementById("tooltip_bg");

        if(municipios) {

            var bbox = municipios.getBBox(),
            nMouseOffsetX = bbox.x + (bbox.width / 2),
            nMouseOffsetY = bbox.y + bbox.height;


        }


            if(textNode) {

                var m = municipios.getScreenCTM();
                p = p.matrixTransform(m.inverse());

                municipios.setAttribute("cx", p.x - nMouseOffsetX);
                municipios.setAttribute("cy", p.y - nMouseOffsetY);
				textNode.firstChild.data = mouseovertext;
		        textNode.setAttributeNS(null,"x", nMouseOffsetX+1000);
                textNode.setAttributeNS(null,"y", nMouseOffsetY+2000);
                textNode.style.fontWeight = "bold"
                textNode.style.visibility = "visible"


		       textNode2.setAttributeNS(null,"x", nMouseOffsetX+2500);
               textNode2.setAttributeNS(null,"y", nMouseOffsetY+parseInt(textNode.style.fontSize)+2000);
               textNode2.style.fontWeight = "bold"
               textNode2.style.visibility = "visible"

			   length = textNode.getComputedTextLength();
			   length2 = textNode2.getComputedTextLength();

			   if (length2 > length){
			    length = length2
			   }

			   fundo.setAttributeNS(null,"width",length+4000);
			   fundo.setAttributeNS(null,"height",parseInt(textNode.style.fontSize) * 2.5);
               fundo.setAttributeNS(null,"x", nMouseOffsetX);
               fundo.setAttributeNS(null,"y", nMouseOffsetY-4000);
			   fundo.style.visibility = "visible"
               fundo.style.fill = "#bababa";

               bClient = false;
            }



    }
